import { useForm } from 'react-hook-form';
import { useHistory } from 'react-router-dom';
import ItemForm from './ItemForm'

export default function AddItem() {

    const [item, setItem] = useState();

    useEffect(() => {
        setItem({
            name: 'mark'
        })
    }, []);

    return <ItemForm />
}
